import React from "react";

export default function AddMsg(props){
    const msg='';
    const handleClick=()=>{
        props.chatData.add(msg);
    }
    return(
        <div>
            <form>
                <input type='text' value={msg}></input>
                <input type='button' onClick={handleClick()}></input>
            </form>
        </div>
    )
}
